YEAH!! I climbed the Wheel of Life, one of my all time dream problems! After working the 60+ moves into perfection I gave it one good go a day and ended up on top on day 5. I took the full experience topping out at the highest point and thus adding a little spice to the end. I can't agree to a route grade, since it doesn't gain much height, nor needs rope or draws, and comparing it to other (only slightly) similar boulders it seems 8C would be fitting. Don't get me wrong, but similar to freeclimbing the Nose, I almost feel a little sad it's over...
Anyway, @louderthan11 is here to shoot with Katha and me, so stay tuned!
