I received a lot of questions since the moment I climbed Hypnotized Minds in #rmnp. I will try to answer most popular ones. "Why does it look so easy?" - long time ago I've read in one book that master differs from the beginner that he does extremely hard moves with ease and without showing the effort. I'm trying to follow this rule and often it is impossible to see how difficult the route is. The most frequent question is "Why do you climb so little outdoors?" - unfortunately I ask myself same question. I almost didn't climb hard routes outdoor: couple of bouldering 8b+ and couple of 9a lead. And the main question "Difficult or not?". I have two answers: 1) I don't have the right and the opportunity to judge the difficulty, I don't have enough experience. This question is to @dawoods89 and to anyone who will climb it later. 2) This route was not extremely difficult for me. It fit me very well and it's what I like. In reality I would not say how difficult it is.
